text:
@basedtweetsonly The whole “story” of removing pronouns after the election is fake.

It happened a long time ago after the SCOTUS Twitter ruling meant I had to add the “personal acct” disclosure.

There weren’t enough chars so I had to swap the end. You can run the timeline to see for yourself.

Speaking of Puerto Rico, our island deserves better than a gubernatorial candidate who led Latinos for Trump.

🇵🇷 Diaspora, talk with your family en la isla about voting for La Alianza:
 @juandalmauPR + @RiveraLassen https://t.co/rUwCTzP9KT

RT @MorePerfectUS: We're told service work is unskilled, but that's just a myth to keep wages down.

@AOC, a former bartender herself, told to us how much skilled labor goes into these jobs.

And how Las Vegas union @Culinary226 could strike before the Super Bowl to get paid for that labor. https://t.co/yYkDXZf2Of

RT @IfNotNowOrg: This ad campaign targeting Rashida Tlaib is dangerous. It should be condemned by Democrats and taken down now.

@DemMaj4Israel &amp; @AIPAC use Republican donor money to pit Jewish Democrats against Muslim Democrats.

We won’t let them tear our communities apart with fear-mongering.

@JDVance1 One little problem with your story: Republicans have the House majority.

They sunk their own bill.

Maybe try running the math and try again.
